import React from "react";
import './inscription.css';
import { useNavigate } from "react-router-dom";
// import { type } from "@testing-library/user-event/dist/type";

// function Field(){
//     const {name,value,onChange,children}=this.props
//     return(
//         <div className="form-outline mb-4">
//             <label htmlFor={name}>{children}</label>
//             {/* l'évènement onChange pour gérer les changement dans les inputs                  */}
//             <input type='text' name={name} value={value} onChange={onChange} id={name} className="form-control form-control-lg"/>       
//         </div>
//     )
// }

// Créer le composant Inscription
export default class Inscription extends React.Component{
 //Créer un constructeur qui prendra en paramètre les propriétés
    constructor(props){
        super(props)
        this.state={
            nom:'',
            prenom:'',
            username:'',
            email:'',
            sexe:'',
            naissance:'',
            lieu:'',
            telephone:'',
            nationalite:'',
            password1:'',
            password2:''
        }
this.handleChange=this.handleChange.bind(this)
    }

// {/* l'évènement onChange fait appel à la fonction handleChange*/}     

handleChange(event){   
    const name=event.target.name
    // const type=event.target.type  
    // const value=   type == 'checkbox' ? event.target.checked : event.target.value          
        this.setState({                    //*Modifier la valeur du champ */}
            [name]: event.target.value
        })
    }

    handleClick = () =>{
        const navigate = useNavigate()
          navigate(-1)
    }

    render(){
        return(
            <div className="back">
            <section className="vh-100 " >
                <div className="container py-5 h-100">
                    <div className="row d-flex justify-content-center align-items-center h-100">
                        <div className="col col-xl-10">
                            <div className="card bord" >
                                <div className="row g-0">
                                    <div className="col-md-6 col-lg-5 d-none d-md-block">
                                        <img src="image3.jpg"
                                        alt="login form" className="img-fluid image"  />
                                    </div>
                                    <div className="col-md-6 col-lg-7 d-flex align-items-center">
                                        <div className="card-body p-4 p-lg-5 text-black">
            
                                            <form>

                                                <div className="d-flex align-items-center mb-3 pb-1">
                                                    <img src="logo_sansfond.png" alt="logo gnb" className="text-center  taille_image"/> 
                                                    {/* <span className="h1 fw-bold mb-0">Global Network Business</span> */}
                                                </div>

                                                <h5 className="fw-normal mb-3 pb-3 space" >Inscrivez-vous</h5>

                                                {/* <Field name='nom' value={this.state.nom} onChange={this.handleChange}>Nom</Field> */}
                                                {/* <Field name='prenom' value={this.state.prenom} onChange={this.handleChange}>Prénom</Field> */}
                                                {/* <Field name='username' value={this.state.username} onChange={this.handleChange}>Pseudo</Field> */}

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Nom</label>
                                                    <input type="text"  className="form-control form-control-lg" id="nom" name="nom" value={this.state.nom} onChange={this.handleChange} placeholder='entrez votre nom'required/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Prénom</label>
                                                    <input type="text"  className="form-control form-control-lg" id="prenom" name="prenom" value={this.state.prenom} onChange={this.handleChange} placeholder='entrez votre/vos prenom(s)' required/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Nom d'utilisateur</label>
                                                    <input type="text"  className="form-control form-control-lg" id="username" name="username" value={this.state.username} onChange={this.handleChange} placeholder="entrez un nom d'utilisateur" required/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Email</label>
                                                    <input type="email"  className="form-control form-control-lg" id="email" name="email" value={this.state.email} onChange={this.handleChange} placeholder="xxxx@gmail.com" required/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label">Sexe</label>
                                                    <select name="sexe" value={this.state.sexe} onChange={this.handleChange} required>
                                                        <option value='homme'>Homme</option>
                                                        <option value='femme'>Femme</option>
                                                    </select>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Date de naissance</label>
                                                    <input type="date"  className="form-control form-control-lg" id=" naissance" name=" naissance" value={this.state.naissance} onChange={this.handleChange} placeholder="entrez votre date de naissance" required/>
                                                </div>
                                               
                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Lieu de naissance</label>
                                                    <input type="text"  className="form-control form-control-lg" id="lieu" name=" lieu" value={this.state.lieu} onChange={this.handleChange} placeholder="entrez votre lieu de naissance"/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Numéro de téléphone</label>
                                                    <input type="tel"  className="form-control form-control-lg" id="telephone" name="telephone" value={this.state.telephone} onChange={this.handleChange} placeholder="entrez votre contact téléphonique" required/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Nationalité</label>
                                                    <input type="text"  className="form-control form-control-lg" id="nationalite" name="nationalite" value={this.state.nationalite} onChange={this.handleChange} placeholder="de quelle nationalité êtes-vous?" required/>
                                                </div>

                                                <div className="form-outline mb-4">
                                                    <label className="form-label" >Password</label>
                                                    <input type="password"  className="form-control form-control-lg" />
                                                </div>
                                                <div className="col md-3">
                                                    <div className="pt-1 mb-4">
                                                    <button className="btn btn-dark btn-lg btn-block" type="button">Login</button>
                                                    </div>
                                                </div>
                                                <div className="col md-6"></div>
                                                <div className="col md-3">
                                                <button onClick={this.handleClick}>Retour<i className="fa-solid fa-circle-chevron-right"></i></button>
                                                </div>
                                                
                                            </form>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
            </div>
        )
    }
}
